syntax = "proto3";

package protocol;

message EchoReq {
    string msg = 1;
}
message EchoRsp {
    string msg = 1;
}

message A {
    int32 a = 1;
    int32 urls = 2;
    int32 id = 3;
}

message B {
    int32 b = 1;
    message HeHeB {
        repeated int32 urls = 1;
    }
    HeHeB hehe_a = 2;
    string what = 3;
}
